import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input and type 'iPhone'
    const searchInputSelector = '#searchInput';
    await page.waitForSelector(searchInputSelector, { timeout: 5000 });
    await page.fill(searchInputSelector, 'iPhone');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate and click the search button
    const searchButtonSelector = '.search-btn';
    await page.waitForSelector(searchButtonSelector, { timeout: 5000 });
    // Use .first() as there are multiple elements with this class
    await page.locator(searchButtonSelector).first().click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_clicked.png'));

    // Extract the value from the search input to verify
    const searchInputValue = await page.inputValue(searchInputSelector);

    return {
      success: true,
      action: "Searched for 'iPhone' products",
      extractedData: {
        searchQuery: searchInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for products",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
